import React,{useState} from 'react';
import "./App.css";

function App() {
  const [text, settext] = useState("");
  const textSend = () => {
    return (
      <div>
        <input
         value={text}
         onChange={(e) => settext(e.target.value)}
        />
        <p>{text}</p>
      </div>
    );
  };

  return (
    <div>
      <textSend/>
    </div>
  );
}

export default App;
